    List<PaymentReceiveView> articleModel;
    ReceiptMaster view;
    string voucherNo = string.Empty;
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    long FinancialYearId;
    long UserId;
    string Email;
    string strMenu = "PaymentIn";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        Email = await sessionStorage.GetItemAsync<string>("Email");
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        UserId = await sessionStorage.GetItemAsync<long>("UserId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    protected void LoadData()
    {
        articleModel = _pyment.ViewCustomerPayment(CompanyId, FinancialYearId, voucherNo);
    }

    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                view = _pyment.EditReceiveCustomer(id);
                bool isSave = false;
                isSave = _pyment.DeletePymentSupplier(view.VoucherNo, view.VoucherTypeId, view.FinancialYearId, view.CompanyId);
                if (isSave == true)
                {
                    Toaster.Add("Delete Successfully.", MatToastType.Info, "PaymentCustomer", null);
                    LoadData();
                    navManager.NavigateTo("inventory/customerpaylist");
                }
                else
                {
                    Toaster.Add("Cannot be delete. already in used.", MatToastType.Warning, "PaymentCustomer", null);
                    navManager.NavigateTo("inventory/customerpaylist");
                }
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }
    void OnPrint(ItemClickEventArgs e)
    {
        var currentRow = e.Data as PaymentReceiveView;
        long partybalanceIdno = currentRow.ReceiptMasterId;
        JsRuntime.InvokeAsync<object>("open", new object[] { ($"/inventory/customerrecprint/{partybalanceIdno}"), "_blank" });
    }
    void OnGmail(ItemClickEventArgs e)
    {
        var currentRow = e.Data as PaymentReceiveView;
        long partybalanceIdno = currentRow.ReceiptMasterId;
        JsRuntime.InvokeAsync<object>("open", new object[] { ($"/inventory/supplierprint/{partybalanceIdno}"), "_blank" });
    }
    void OnSms(ItemClickEventArgs e)
    {
        var currentRow = e.Data as PaymentReceiveView;
        long partybalanceIdno = currentRow.ReceiptMasterId;
        JsRuntime.InvokeAsync<object>("open", new object[] { ($"/inventory/suppliershow/{partybalanceIdno}"), "_blank" });
    }

